import React from 'react'
import './step5.scss'

export default function Step5({ nextStep, prevStep }) {
  return (
    <div className="step5">
      <h2>Szczegółowe dane nieruchomości</h2>
      <input type="text" placeholder="Szczegół 1" />
      <input type="text" placeholder="Szczegół 2" />
      <input type="text" placeholder="Szczegół 3" />
      <input type="text" placeholder="Szczegół 4" />
      <input type="text" placeholder="Szczegół 5" />
      <button onClick={prevStep}>Wstecz</button>
      <button onClick={nextStep}>Dalej</button>
    </div>
  );
}
